import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

export default function Navbar() {
  return (
    <View style={styles.mai}>
    <View style={styles.container}>
      <Text style={styles.navItem}>Home</Text>
      <Text style={styles.navItem}>Men</Text>
      <Text style={styles.navItem}>Women</Text>
      <Text style={styles.navItem}>Electronics</Text>
      <Text style={styles.navItem}>Kids</Text>
      <Text style={styles.navItem}>Home-Decor</Text>
      <Text style={styles.navItem}>Profile</Text>
    </View>
    <View style={{marginlef:'50%'}}>
        <Text style={styles.logo}>KMART</Text>
    </View>
    </View>
  );
}

const styles = StyleSheet.create({
    mai:{
      justifyContent: 'space-between',
      flexDirection: 'row',
      backgroundColor: 'orange',
      alignItems: 'center',
    },
  container: {
    flexDirection: 'row', // Display items in a row
    alignItems: 'center', // Vertically align items
    justifyContent: 'center', // Horizontally align items
    backgroundColor: '#333', // Background color
    height: 60, // Height of the navigation bar
  },
  navItem: {
    color: 'white', // Text color
    margin: 10, // Add some spacing between items
    fontSize: 18, // Adjust font size as needed
  },
  logo:{
    color: 'white', 
    margin: 10, // Add some spacing between items
    fontSize: 18, // Adjust font size as needed
  }
});
